  $(function () {
  let container = $('#page-bokep');
  container.pagination({
  pageSize: 60,
  showPageNumbers: false,
  showNavigator: true,
  formatNavigator: 'Hal. ke-<span style="color: #f00"><b><%= currentPage %></span></b>, <b><%= totalPage %></b> Halaman, Total Video <b><%= totalNumber %></b>',
  showGoInput: true,
  showGoButton: true,
  formatGoInput: 'Menuju halaman ke- <%= input %>',
  position: 'top',
  className: 'paginationjs-theme-blue',
  dataSource: data,
  
  callback: function (data, pagination) {
      var dataHtml = '';
      data.forEach((item, i)=>{
          dataHtml += '<div id="video-bokep" data-nama="' + item.title + '"><div class="row sort-item"><a href="' + item.link + '" onclick="myAds()" style="color:black"><img id="poster" src="' + item.poster + '"  alt="' + item.title + '" width="100%" loading=lazy style="max-inline-size:100%;block-size: auto;aspect-ratio: 16/9;object-fit: cover;border-radius:10px"></a><h6 id="judul-bokep"><b>' + item.title + '</b></h6></div></div>';
          });

          $("#data-bokep").html(dataHtml);
          
        }
    })
  })
  
$(function() {
  $("#search-movie").on("keyup", function() {
    var value = $(this).val().toLowerCase();
    if (value.length) {
      $("#data-bokep #video-bokep").filter(function() {
        $("#data-bokep").show();
        $(this).toggle($(this).text().toLowerCase().indexOf(value) > -1)
      });
    } else {
      $("#data-bokep").hide();
    }
  });
});

